Validate RDF data against SHACL shapes: import { parseTurtle } from 'unrdf'; // Define SHACL shapes
const shapes = await parseTurtle(` @prefix sh: <http://www.w3.org/ns/shacl#> . @prefix ex: <http://example.org/> . @prefix foaf: <http://xmlns.com/foaf/0.1/> . @prefix xsd: <http://www.w3.org/2001/XMLSchema#> . ex:PersonShape a sh:NodeShape ; sh:targetClass foaf:Person ; sh:property [ sh:path foaf:name ; sh:minCount 1 ; sh:maxCount 1 ; sh:datatype xsd:string ; ] ; sh:property [ sh:path foaf:age ; sh:minCount 1 ; sh:datatype xsd:integer ; sh:minInclusive 0 ; sh:maxInclusive 150 ; ] .
`); // Validate data
const validation = await system.validate({ dataGraph: store, shapesGraph: shapes
}); if (!validation.conforms) { console.log('Validation errors:'); validation.results.forEach(result => { console.log(`- ${result.message}`); });
} SHACL validation is performed during transactions when validation hooks are registered. Failed validations cause the transaction to roll back.

