Always wrap UNRDF operations in try-catch blocks: try { await system.executeTransaction({ additions: [quad(s, p, o)], removals: [], actor: 'user' });
} catch (error) { if (error.message.includes('validation')) { console.error('Validation failed:', error.message); } else if (error.message.includes('timeout')) { console.error('Query timeout:', error.message); } else { console.error('Transaction failed:', error); } // Transaction automatically rolled back // Store state is preserved
} UNRDF transactions have **automatic rollback** on failure. The store always remains in a consistent state.

