Here's a complete, runnable example: import { createDarkMatterCore, defineHook, registerHook } from 'unrdf';
import { namedNode, quad, literal } from '@rdfjs/data-model'; // 1. Define the hook
const nameValidationHook = defineHook({ meta: { name: 'person-name-required', description: 'Ensures all persons have names' }, when: { kind: 'sparql-ask', query: ` PREFIX foaf: <http://xmlns.com/foaf/0.1/> ASK { ?person a foaf:Person . FILTER NOT EXISTS { ?person foaf:name ?name } } ` }, run: async (event) => { if (event.result === true) { throw new Error('All persons must have a name'); } }
}); // 2. Create system and register hook
const system = await createDarkMatterCore();
await registerHook(nameValidationHook); // 3. Test valid transaction (should succeed)
await system.executeTransaction({ additions: [ quad( namedNode('http://example.org/alice'), namedNode('http://www.w3.org/1999/02/22-rdf-syntax-ns#type'), namedNode('http://xmlns.com/foaf/0.1/Person') ), quad( namedNode('http://example.org/alice'), namedNode('http://xmlns.com/foaf/0.1/name'), literal('Alice') ) ], removals: [], actor: 'admin'
}); console.log(' Valid transaction succeeded'); // 4. Test invalid transaction (should fail)
try { await system.executeTransaction({ additions: [ quad( namedNode('http://example.org/bob'), namedNode('http://www.w3.org/1999/02/22-rdf-syntax-ns#type'), namedNode('http://xmlns.com/foaf/0.1/Person') ) // Missing name! ], removals: [], actor: 'admin' });
} catch (error) { console.log(' Invalid transaction rejected:', error.message);
} // 5. Cleanup
await system.cleanup(); Save this as first-hook.mjs and run: node first-hook.mjs Expected output:  Valid transaction succeeded
 Invalid transaction rejected: All persons must have a name

